The contracted net revenue in the local currency of the {@link ProposalLineItem}.

See {@link #CONTRACTED_REVENUE_CONTRACTED_NET_REVENUE}
<p>Can correspond to any of the following in the DFP UI: Contracted revenue (local), Contracted revenue (net) (local). Compatible with any of the following report types: HISTORICAL, SALES, BUSINESS_INTELLIGENCE.</p>

The name and email address in the form of name(email) of the trafficker for
{@link Dimension#ORDER_NAME}
<p>Corresponds to "Trafficker" in the DFP UI. Compatible with any of the following report types: HISTORICAL, SELL_THROUGH, REACH, SALES, DATA_LEAKAGE, DFP_HISTORICAL_DATA_STUDIO, SAMPLED_HISTORICAL.</p>

Represents gross cost per unit in local currency for {@link Dimension#PROPOSAL_LINE_ITEM_NAME}.

See {@link #PROPOSAL_LINE_ITEM_COST_PER_UNIT_GROSS}
<p>Corresponds to "Rate (gross) (local)" in the DFP UI. Compatible with any of the following report types: HISTORICAL, SELL_THROUGH, REACH, SALES, SAMPLED_HISTORICAL.</p>

Represents the size of {@link ProposalLineItem#creativePlaceholders}
for {@link Dimension#PROPOSAL_LINE_ITEM_NAME}.
<p>Corresponds to "Sizes" in the DFP UI. Compatible with any of the following report types: HISTORICAL, SELL_THROUGH, REACH, SALES, SAMPLED_HISTORICAL.</p>

Represents the {@link Dimension#PRODUCT_NAME}'s rate in a {@link Dimension#RATE_CARD_NAME}
and {@link Dimension#PRODUCT_PACKAGE_NAME}.
<p>Corresponds to "Packaged product rate" in the DFP UI. Compatible with any of the following report types: HISTORICAL, REACH, SALES, SAMPLED_HISTORICAL.</p>

Use the publisher's time zone. For DFP reports, this time zone is compatible with all
metrics. For Ad Exchange reports, this time zone is not compatible with "Bids" and "Deals"
metrics.

<p><b>Note:</b> if your report includes "time unit" dimensions, only the DFP "time unit"
dimensions are compatible with this timezone, e.g.:
<ul>
<li> {@link com.google.ads.publisher.api.service.reports.Dimension.DATE}
<li> {@link com.google.ads.publisher.api.service.reports.Dimension.WEEK}
<li> {@link com.google.ads.publisher.api.service.reports.Dimension.MONTH_AND_YEAR}
</ul>

Use the Ad Exchange time zone (Pacific Time Zone). This time zone is only compatible with
Ad Exchange metrics.

<p><b>Note:</b> if your report includes "time unit" dimensions, only the Ad Exchange
"time unit" dimensions are compatible with this timezone, e.g.:
<ul>
<li> {@link com.google.ads.publisher.api.service.reports.Dimension.AD_EXCHANGE_DATE}
<li> {@link com.google.ads.publisher.api.service.reports.Dimension.AD_EXCHANGE_WEEK}
<li> {@link com.google.ads.publisher.api.service.reports.Dimension.AD_EXCHANGE_MONTH}
</ul>

Returns the URL at which the report file can be downloaded.
<p>
The report will be generated as a gzip archive, containing the report file itself.

@param reportJobId the ID of the {@link ReportJob}
@param exportFormat the {@link ExportFormat} for the report file
@return the URL for report file download

Returns the URL at which the report file can be downloaded, and allows for customization
of the downloaded report.
<p>
By default, the report will be generated as a gzip archive, containing the report file itself.
This can be changed by setting {@link ReportDownloadOptions#useGzipCompression} to false.

@param reportJobId the ID of the {@link ReportJob}
@param reportDownloadOptions the {@link ReportDownloadOptions} for the request
@return the URL for report file download

